import Vue from 'vue'
export default Vue.extend({
    name: 'Position-item',
    props: ['value'],
    computed: {
        positionName(): string
        {
            return this.value.name;
        },
        location(): string
        {
            return this.value.location || '';
        },
        orgType(): string
        {
            return this.value.org_type || '';
        },
        team(): any
        {
            return this.value.team ;
        },
        statuses(): Array<string> {
            return this.value.statuses;
        }
    }
})
